import React, { useState } from "react";
import "../CSS/Group.css";
import LogoAndTitle from "../Components/LogoAndTitle";
import { group } from "console";
import "../Components/groupList.tsx";
function Group() {
  return (
    <div className="Group">
      <header className="Group-Header">
        <LogoAndTitle />
      </header>
    </div>
  );
}
interface GroupInfo {
  groupName: string;
}
export const GroupList: React.FC = () => {
  const [group, setGroup] = useState(new Array<GroupInfo>());

  const addGroup = (groupName: string) => {
    const g = group.slice();
    g.push({ groupName });
    setGroup(g);
  };

  const removeGroup = (i: number) => {
    const g = group.slice();
    g.splice(i, 1);
    setGroup(g);
  };

  return (
    <div>
      <h1>Group Name</h1>
    </div>
  );
};

export default Group;
